import { Outlet, Link } from "react-router-dom";

const Layout = () => {
  return (
    <>
      <nav>
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/boobPage">Boob Page</Link>
          </li>
        </ul>
      </nav>
      <img src={"https://external-content.duckduckgo.com/iu/?u=https%3A%2F%2Fassets.entrepreneur.com%2Fcontent%2F3x2%2F2000%2F20200429211042-GettyImages-1164615296.jpeg&f=1&nofb=1&ipt=37c6680906ebe83bb4e872064a2c8ae09bbcc21d985e40e563745c1b4c682489&ipo=images"} alt= "boob" />

      <Outlet />
    </>
  )
};

export default Layout;
